const routes = {

    menu: [
        {
            path: 'pizza',
            content: 'Pizza'
        },
        {
            path: 'drinks',
            content: 'Drinks'
        },
        {
            path: 'cake',
            content: 'Cake'
        }
    ]
    ,
    auth: [
        {
            path: 'signin',
            content: 'SignIn'
        },
        {
            path: 'signup',
            content: 'SignUp'
        }
    ]
};

export default routes;
